// src/pages/Home.js
import React from 'react';

function Home() {
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // 백엔드의 /api/posts 엔드포인트로 GET 요청
    axios.get('/api/posts')
      .then(response => {
        setPosts(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error('글 목록 불러오기 에러:', error);
        setLoading(false);
      });
  }, []);
  return (
    <div style={{ padding: '20px' }}>
      <h1>VS Code 스타일 블로그</h1>
      <p>글 목록(추후 구현 예정)</p>
    </div>
  );
}

export default Home;
